import React from 'react';
import './pricing.css';

const PricingCard = ({ plan, price, features }) => (
  <div className="pricing-card">
    <h2 className='planHeading' style={{color: "white"}}>{plan}</h2>
    <h1 className='planPrice' style={{color: "lightBlue"}}>{price}</h1>
    <ul>
      {features.map((feature, index) => (
        <li className='newLi' key={index}>
          {feature.available ? '✔️' : '❌'} {feature.name}
        </li>
      ))}
    </ul>
  </div>
);

const Pricing = () => (
  <div className="pricing-card-container">
    <PricingCard
      plan="Basic"
      price="$10"
      features={[
        { name: "Feature 1", available: true },
        { name: "Feature 2", available: false },
        { name: "Feature 3", available: true }
      ]}
    />
    <PricingCard
      plan="Premium"
      price="$20"
      features={[
        { name: "Feature 1", available: true },
        { name: "Feature 2", available: true },
        { name: "Feature 3", available: true },
        { name: "Feature 4", available: false }
      ]}
    />
    <PricingCard
      plan="Pro"
      price="$30"
      features={[
        { name: "Feature 1", available: true },
        { name: "Feature 2", available: true },
        { name: "Feature 3", available: true },
        { name: "Feature 4", available: true },
        { name: "Feature 5", available: true }
      ]}
    />
  </div>
);

export default Pricing;
